function generateCheque(cheque_no,issued_date,issued_to_name,issued_to_desg,issued_reason,issued_by_name,issued_by_desg,sign_img_path){
	var doc = new jsPDF('landscape');
// var h1 = 50;
var width = doc.internal.pageSize.width;
var height = doc.internal.pageSize.height;
// var aspectwidth1 = (height - h1) * (9 / 16);

var img = new Image();
img.src =  /* [[@{/image/AppreciationCheque.jpg}]] */'/AppreciationCheque/image/AppreciationCheque.jpg';
var sign_img = new Image();
if(sign_img_path!=''){
	sign_img.src =  sign_img_path;
}


// We'll make our own renderer to skip this editor
var specialElementHandlers = {
	'#editor' : function(element, renderer) {
		return true;
	}
};

doc.addImage(img, 'JPEG', 0, 0, width,height,
		'appreciation-cheque');
if(sign_img_path!=''){
doc.addImage(sign_img, 'JPEG', 237, 169, 18,15,
		'signoff');
}


var font = '';
doc.addFileToVFS('MTCORSVA.ttf', font);
doc.addFont('MTCORSVA.ttf', 'MTCORSVA', 'normal');
doc.setFont('MTCORSVA','normal');

// var font =
// '';
// doc.addFileToVFS('Courgette-Regular-normal.ttf', font);
// doc.addFont('Courgette-Regular-normal.ttf', 'Courgette-Regular', 'normal');
// doc.setFont('Courgette-Regular','normal');

doc.setFontSize(15);
// doc.setFontSize(16);
doc.text(cheque_no, 53, 83, 'left');
doc.text(issued_date, 267, 83, 'right');
doc.setFontSize(18);
doc.text(issued_by_name+', '+issued_by_desg, 97, 184, 'left');
// doc.text(issued_by_desg, 165, 184, 'left');


doc.setFontSize(20);
// doc.setFontSize(21);

doc.text(issued_to_name+', '+issued_to_desg, 80, 105, 'left');
var splitReason = doc.splitTextToSize(issued_reason, 168);

doc.text(splitReason[0], 109, 129.5, 'left');
 /* <![CDATA[ */	
// for(var i=1;i<splitTitle.length;i++){
var reason_next_line='';
for (var i=1;i<splitReason.length;i++){
	reason_next_line=reason_next_line+splitReason[i];
}

if(splitReason.length>1){
	var splitReasonNextLine = doc.splitTextToSize(reason_next_line, 228);
// doc.text(splitReason[1], 40, 148, 'left');
	doc.text(splitReasonNextLine[0], 40, 149, 'left');
}

// }
 /* ]]> */
 
//if([[${session.sessionMaster.host!='10.146.65.55' and session.sessionMaster.host!='webapp.indianoil.co.in'}]]){
//	doc.setFontSize(20);
//	doc.setTextColor(255, 0, 0);
//	doc.text('This template has been generated from Test Server.', 10, 12, 'left');
//	}
doc.save('appreciation-cheque.pdf');
// doc.output("dataurlnewwindow");

doc.output("datauristring");
}